import React from 'react'

let getId = (course) => {
    return course.id
}

let getTitle = (course) => {
    return course.title
}

let addCourse = (cart, course) => {
    cart.push(course)
}

const SearchListItem = ({course, cart}) => {
    return (
        <div className = "search-list-item">
            <button onClick = {addCourse(cart, course)}> + </button>
            <h3>{getId(course)}</h3>
            <p>{getTitle(course)}</p>

        </div>
    )
}

export default SearchListItem
